import React from "react";
import './ListHotels.css'

const listHotels = [
	{
		"name": "Aparthotel Stare Miasto",
		"city": "Madrid",
		"price": 120,
		"rate": 8.9,
		"type": "Excellent",
		"image_url": "./images/hotel_1.webp"
	},
	{
		"name": "Comfort Suites Airport",
		"city": "Austin",
		"price": 140,
		"rate": 9.3,
		"type": "Exceptional",
		"image_url": "./images/hotel_2.jpg"
	},
	{
		"name": "Four Seasons Hotel",
		"city": "Lisbon",
		"price": 99,
		"rate": 8.8,
		"type": "Excellent",
		"image_url": "./images/hotel_3.jpg"
	},
	{
		"name": "Hilton Garden Inn",
		"city": "Berlin",
		"price": 105,
		"rate": 8.9,
		"type": "Excellent",
		"image_url": "./images/hotel_4.jpg"
	}
]


function ListHotels() {
  return (
    <div>
      <h3>Home guests love</h3>
      <div className='container-listhotels'>
        {listHotels.map(hotels => (
          <div className='' key={hotels['name']}>
            <img src={hotels['image']} alt={hotels['name']} width='100%' height='60%' />
            <h4>{hotels['name']}</h4>
            <div style={{fontSize:'0.91rem'}}>{`${hotels['count']} hotels`}</div>
          </div>
        ))}
      </div>
    </div>
  )
}

export default ListHotels
